import React, { useEffect, useState } from "react";

const Gallery = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    fetch("https://68b826bcb715405043274639.mockapi.io/api/properties/PropertyListing")
      .then((res) => res.json())
      .then((data) => setProperties(data))
      .catch((err) => console.error("Error fetching data:", err));
  }, []);

  return (
    <div style={{ width: "90%", margin: "20px auto" }}>
      {/* Header */}
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: "15px" }}>
        <h2 style={{ fontSize: "22px", fontWeight: "bold" }}>Featured Properties</h2>
        <button
          style={{
            background: "#007bff",
            color: "white",
            border: "none",
            padding: "8px 16px",
            cursor: "pointer",
            borderRadius: "6px",
          }}
        >
          View All
        </button>
      </div>

      {/* Properties Grid */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(4, 1fr)",
          gap: "15px",
        }}
      >
        {properties.slice(0, 4).map((item) => (
          <div
            key={item.id}
            style={{
              background: "#fff",
              borderRadius: "10px",
              padding: "10px",
              boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
            }}
          >
            <img
              src={item.image || "https://via.placeholder.com/250"}
              alt={item.name}
              style={{
                width: "100%",
                height: "180px",
                borderRadius: "10px",
                objectFit: "cover",
                display: "block",
              }}
            />
            <p style={{ fontWeight: "bold", marginTop: "5px" }}>{item.name}</p>
            <p style={{ fontSize: "14px", color: "#666" }}>{item.city}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Gallery;
